import React, { useState, useEffect } from "react";
import Hero from "./Hero";
import SearchResults from "./SearchResults";
import axios from "axios";

const Main = () => {
  const [state, setState] = useState({
    categories: {
      data: []
    }
  });

  useEffect(() => {
    axios("http://localhost:5000/api/project-categories")
      .then(categories => {
        setState(categories);
      })
      .catch(err => console.log(err));
  }, []);
  console.log(state);
  return (
    <div>
      <Hero />
      <SearchResults />
    </div>
  );
};

export default Main;
